import React, { useState } from 'react';
import axios from 'axios';

const SampleChoice: React.FC = () => {
  const [episodeNumber, setEpisodeNumber] = useState<number>(1);
  axios.get(`localhost:3000/episode_number`)
      .then(res => {
        const episode_number = res.data.episode_number;
        setEpisodeNumber(episode_number);
      })
  return (
    <div className="flex flex-row mx-auto">
      <div className="flex flex-col">
        <video autoPlay loop muted width="320" height="320">
          <source src={`videos/video_one_${episodeNumber}.mp4`} type="video/mp4"/>
        </video>
        <button className="bg-amber-400 hover:bg-amber-500">1</button>
      </div>
      <div className="flex flex-col">
        <video autoPlay loop muted width="320" height="320">
          <source src={`videos/video_two_${episodeNumber}.mp4`} type="video/mp4"/>
        </video>
        <button className="bg-amber-400 hover:bg-amber-500 active:bg-amber-600">2</button>
      </div>
    </div>
  );
}

export default SampleChoice;
